	@Body[Jool]
	{
		%Orbit
		{
			inclination = 1.30400002002716
			eccentricity = 0.0500000007450581
			semiMajorAxis = 68773560320
			longitudeOfAscendingNode = 52
			argumentOfPeriapsis = 0
			meanAnomalyAtEpoch = 0.100000001490116
		}
	}
	Asteroid
	{
		name = Trojans
		Locations
		{
			Around
			{
				Body
				{
					body = Sun
					// important stuff
					semiMajorAxis
					{
						minValue = #$/Body[Jool]/Orbit/semiMajorAxis$
						@minValue *= 0.85
						maxValue = #$minValue$
						@maxValue *= 1.3
					}
					meanAnomalyAtEpoch
					{
						maxValue = #$/Body[Jool]/Orbit/meanAnomalyAtEpoch$
						@maxValue -= 0.74176493209759 // 0.872664625997165
						minValue = #$maxValue$
						@minValue -= 0.610865238198015 // 0.349065850398866
					}
					// meaningless stuff
					inclination
					{
						minValue = #$/Body[Jool]/Orbit/inclination$
						@minValue *= 0.99
						maxValue = #$minValue$
						@maxValue *= 1.02
					}
					eccentricity
					{
						minValue = #$/Body[Jool]/Orbit/eccentricity$
						@minValue *= 0.99
						maxValue = #$minValue$
						@maxValue *= 1.02
					}
					longitudeOfAscendingNode
					{
						minValue = #$/Body[Jool]/Orbit/longitudeOfAscendingNode$
						@minValue *= 0.99
						maxValue = #$minValue$
						@maxValue *= 1.02
					}
					argumentOfPeriapsis
					{
						minValue = #$/Body[Jool]/Orbit/argumentOfPeriapsis$
						@minValue *= 0.99
						maxValue = #$minValue$
						@maxValue *= 1.02
					}
					probability = 100
					reached = false
				}
			}
		}
		interval = 5
		minUntrackedLifetime = 2
		maxUntrackedLifetime = 5
		probability = 100
		spawnGroupMinLimit = 8
		spawnGroupMaxLimit = 12
		Size
		{
			key = 0 0
			key = 0.3 0.45
			key = 0.7 0.55
			key = 1 1
		}
	}
